import React, { useState } from 'react';
import { propertyData, getUniqueLocations } from './data';
import './App.css';

const availableLocations = getUniqueLocations(propertyData);

const PropertyCard = ({ property, label }) => {
    if (!property) {
        return (
            <div className="property-card empty-card">
                <div style={{ padding: '20px' }}>
                    <h3 style={{ margin: 0 }}>{label}</h3>
                    <p style={{ marginTop: '10px', color: '#666' }}>
                        Select a location above.
                    </p>
                </div>
            </div>
        );
    }

    const originalPrice = property.price;
    const predictedPrice = property.predicted_price;

    const formattedOriginal =
        typeof originalPrice === 'number'
            ? originalPrice.toLocaleString('en-US', {
                  style: 'currency',
                  currency: 'USD',
                  maximumFractionDigits: 0,
              })
            : null;

    const formattedPredicted =
        typeof predictedPrice === 'number'
            ? predictedPrice.toLocaleString('en-US', {
                  style: 'currency',
                  currency: 'USD',
                  maximumFractionDigits: 0,
              })
            : null;

    return (
        <div className="property-card">
            <h3 className="card-label">{property.title}</h3>

            <div className="image-container">
                <img
                    src={property.image_url}
                    alt={property.title}
                    className="property-image"
                />
            </div>

            <div className="image-info-bar">
                <div className="overlay-price-block">
                    <div className="predicted-price-text">
                        Predicted: <strong>{formattedPredicted}</strong>
                    </div>
                    <div className="original-price-text">
                        Original: {formattedOriginal}
                    </div>
                </div>

                <div className="overlay-stats-location-block">
                    <div className="stats-row-overlay">
                        <strong>{property.bedrooms}</strong>&nbsp;bds
                        <span className="stat-separator-overlay">|</span>
                        <strong>{property.bathrooms}</strong>&nbsp;ba
                        <span className="stat-separator-overlay">|</span>
                        <strong>{property.size_sqft.toLocaleString()}</strong>
                        &nbsp;sqft
                    </div>

                    <div className="overlay-location-text">
                        {property.location}
                    </div>
                </div>
            </div>

            <div className="amenities-container-bottom">
                <ul className="amenities-list">
                    {property.amenities.map((amenity, index) => (
                        <li key={index}>{amenity}</li>
                    ))}
                </ul>
            </div>
        </div>
    );
};

const PropertyComparison = () => {
    const [location1, setLocation1] = useState('');
    const [location2, setLocation2] = useState('');
    const [comparisonProps, setComparisonProps] = useState({
        prop1: null,
        prop2: null,
    });

    const updateComparisonProperties = (loc1, loc2) => {
        const propA =
            propertyData.find(p => p.location === loc1) || null;
        const propB =
            propertyData.find(p => p.location === loc2) || null;

        setComparisonProps({ prop1: propA, prop2: propB });
    };

    const handleCompare = async () => {
        if (!location1 || !location2 || location1 === location2) {
            setComparisonProps({ prop1: null, prop2: null });
            return;
        }

        try {
            const res = await fetch('http://127.0.0.1:8000/compare', {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify({
                    address1: location1,
                    address2: location2,
                }),
            });

            if (res.ok) {
                const data = await res.json();

                const a =
                    data.result && data.result.address1
                        ? data.result.address1
                        : null;
                const b =
                    data.result && data.result.address2
                        ? data.result.address2
                        : null;

                const localA =
                    propertyData.find(p => p.location === location1) ||
                    null;
                const localB =
                    propertyData.find(p => p.location === location2) ||
                    null;

                const mergedA = a ? { ...(localA || {}), ...a } : localA;
                const mergedB = b ? { ...(localB || {}), ...b } : localB;

                setComparisonProps({
                    prop1: mergedA,
                    prop2: mergedB,
                });
                return;
            }
        } catch (err) {
            console.warn(
                'Backend compare failed, falling back to local data',
                err
            );
        }

    };

    return (
        <div className="property-comparison-app">
            <header className="app-header">
                <h1 className="header-title">
                    Property Comparison & Price Prediction App
                </h1>

                <div className="input-group">
                    <select
                        className="location-input"
                        value={location1}
                        onChange={e => setLocation1(e.target.value)}
                    >
                        <option value="" disabled>
                            Select location
                        </option>
                        {availableLocations.map(loc => (
                            <option key={loc} value={loc}>
                                {loc}
                            </option>
                        ))}
                    </select>

                    <span className="vs-label">vs</span>

                    <select
                        className="location-input"
                        value={location2}
                        onChange={e => setLocation2(e.target.value)}
                    >
                        <option value="" disabled>
                            Select location
                        </option>
                        {availableLocations.map(loc => (
                            <option key={loc} value={loc}>
                                {loc}
                            </option>
                        ))}
                    </select>

                    <button
                        className="compare-button"
                        onClick={handleCompare}
                        disabled={
                            !location1 ||
                            !location2 ||
                            location1 === location2
                        }
                    >
                        Compare
                    </button>
                </div>
            </header>

            {comparisonProps && (
                <main className="comparison-container">
                    <PropertyCard
                        property={comparisonProps.prop1}
                        label="Property A"
                    />
                    <PropertyCard
                        property={comparisonProps.prop2}
                        label="Property B"
                    />
                </main>
            )}
        </div>
    );
};

export default PropertyComparison;
